        <header>
             <footer class="footer mt-auto py-3 bg-light">
        <div class="page-links col-lg-4 col-xs-12 col-md-4 col-sm-4 footer-classic aircanada-logo-aco" id="">
	        <div class="row">
				<img src="/images/ac_logo.svg" alt="main backgroud image" />

          </div>
	      </div>
      </footer>
      </header>
            )
        }
